import React from 'react';
import ReactDOM from 'react-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowsAltV, faCoffee } from '@fortawesome/free-solid-svg-icons'; 

const element = <FontAwesomeIcon icon={faArrowsAltV} style={style.boxIcon}/>



/**
 * @file module:src/components/customExpandedBox
 * @param {*} props
 * @returns 
 */

export default function CustomExpandedBox(props){
    
    console.log("field received",props.fieldValues);

    console.log("FIELD LIST",props.fieldsList);
    /**
     * 
     * @returns 
     */
    function mountFieldList(){
        let fieldValues = props.fieldValues;
        console.log("FIELD VALUES::",fieldValues);
        
        return (
        props.fieldsList.map((field) =>
            { 
            return ( 
                <div style={style.boxContent}>
                    {field.label}:{fieldValues[field.fieldKey]}
                </div>
            )}
        ) )
    };

    return (
        <div style={props && props.boxHeigt ? {...style.boxWrapper,height:props.boxHeigt} : style.boxWrapper}>
            <button style={style.boxButton}>{element}</button>
            <h1 style={style.extendedTitle}>{props && props.boxTitle ? props.boxTitle : ""}</h1>
            {mountFieldList()} 
        </div>
    )
} 

const style = {
    boxWrapper: {
        backgroundColor: "#d9d9d9",
        width: "100%", 
        height: "30%"
        
    },
    extendedTitle:{
        display: "flex",
        textAlign: "center",
        justifyContent: "center", 
        fontSize : "18px",
        color: "#545454",
        padding: "10px 2%"
    },
    boxText:{
        color: "#ffffff",
        padding: "20px 2%"
    },
    boxContent: {
        backgroundColor:"#fff",
        width:"100%",
        fontSize: "18px"
    },
    boxButton:{
        width: "200px",
        height: "40px"
    },
    boxIcon: {
    }
}
